import React, { useEffect, useRef } from 'react';
import { Link } from 'react-router-dom';

const GraphicDesign = () => {
  const observerRef = useRef();

  useEffect(() => {
    observerRef.current = new IntersectionObserver((entries) => {
      entries.forEach(entry => {
        if (entry.isIntersecting) {
          entry.target.classList.add('animate');
        }
      });
    }, { threshold: 0.1 });

    document.querySelectorAll('.scroll-animate').forEach(el => {
      observerRef.current.observe(el);
    });

    return () => observerRef.current?.disconnect();
  }, []);

  return (
    <div className="graphic-design-page" style={{ marginTop: '76px' }}>
      <style jsx>{`
        .scroll-animate {
          opacity: 0;
          transform: translateY(30px);
          transition: all 0.8s ease;
        }
        .scroll-animate.animate {
          opacity: 1;
          transform: translateY(0);
        }
        .fade-left { transform: translateX(-30px); }
        .fade-right { transform: translateX(30px); }
        .scale { transform: scale(0.9); }
        .fade-left.animate { transform: translateX(0); }
        .fade-right.animate { transform: translateX(0); }
        .scale.animate { transform: scale(1); }
        .delay-1 { transition-delay: 0.1s; }
        .delay-2 { transition-delay: 0.2s; }
        .delay-3 { transition-delay: 0.3s; }
        .delay-4 { transition-delay: 0.4s; }
        .delay-5 { transition-delay: 0.5s; }
        .delay-6 { transition-delay: 0.6s; }

        @keyframes float {
          0%, 100% { transform: translateY(0px); }
          50% { transform: translateY(-20px); }
        }
        .floating { animation: float 3s ease-in-out infinite; }

        @keyframes borderRotate {
          0% { background-position: 0% 50%; }
          50% { background-position: 100% 50%; }
          100% { background-position: 0% 50%; }
        }

        @media (max-width: 768px) {
          .hero-section h1 { font-size: 2rem !important; }
          .hero-section .col-lg-6 { margin-bottom: 2rem; }
          .service-card { margin-bottom: 1rem; }
          .brand-values img { width: 80px !important; height: 80px !important; }
        }
      `}</style>

      {/* Hero Section */}
      <section className="hero-section py-5" style={{ backgroundColor: '#f8f9fa', minHeight: '80vh' }}>
        <div className="container">
          <div className="row align-items-center">
            <div className="col-lg-6 mb-4 scroll-animate fade-left delay-1">
              <div style={{ position: 'relative' }}>
                <div style={{
                  position: 'absolute',
                  top: '-20px',
                  left: '-20px',
                  width: '60px',
                  height: '60px',
                  background: 'linear-gradient(45deg, #4facfe, #e91e63)',
                  borderRadius: '15px',
                  zIndex: 1
                }}></div>
                <div style={{
                  position: 'absolute',
                  bottom: '-30px',
                  right: '-30px',
                  width: '80px',
                  height: '80px',
                  background: 'linear-gradient(135deg, #ffc107, #ff5722)',
                  borderRadius: '20px',
                  zIndex: 1
                }}></div>
                <img 
                  src="/images/graphic.png" 
                  alt="Graphic Design" 
                  className="img-fluid floating"
                  style={{ position: 'relative', zIndex: 2, maxWidth: '100%' }}
                />
              </div>
            </div>
            <div className="col-lg-6 scroll-animate fade-right delay-2">
              <p className="text-uppercase fw-bold mb-3" style={{ color: '#e91e63', fontSize: '14px', letterSpacing: '1px' }}>OVERVIEW</p>
              <h1 className="fw-bold mb-4" style={{ color: '#1a237e', fontSize: '3rem', lineHeight: '1.2' }}>
                Custom Graphic Design
              </h1>
              <h3 className="mb-4" style={{ color: '#e91e63', fontSize: '1.5rem' }}>
                Are you in need of creative graphic design services?
              </h3>
              <p className="text-muted mb-4" style={{ fontSize: '16px', lineHeight: '1.6' }}>
                Look no further! We offer a wide range of services to meet all your graphic design needs. Our services include advertisement design, logo design, brochure design, and corporate identity design. Graphic design is one way that companies connect with consumers. Design can be used to promote and sell products, to convey a message, or to develop a brand identity.
              </p>
              <p className="text-muted" style={{ fontSize: '16px', lineHeight: '1.6' }}>
                Graphic design is also known as communication design, and Graphic Designers are essentially visual communicators. They bring visual concepts to life, most commonly through graphic design software, and inform or engage consumers through text, graphics and images.
              </p>
            </div>
          </div>
        </div>
      </section>

      {/* Advanced Tools Section */}
      <section className="tools-section py-5" style={{ backgroundColor: 'white' }}>
        <div className="container">
          <div className="row align-items-center">
            <div className="col-lg-6 scroll-animate fade-left delay-1">
              <h2 className="fw-bold mb-4" style={{ color: '#1a237e', fontSize: '2.5rem', lineHeight: '1.2' }}>
                We use advanced graphic designing tools to create impressive ideas for you
              </h2>
              <p className="text-muted mb-4" style={{ fontSize: '16px', lineHeight: '1.6' }}>
                We have an experienced team of designers who specialize in creating high-quality visuals that will captivate your audience and make your business stand out from the competition. Our designs are tailored to meet the needs of each individual customer and our goal is to ensure that it reflects the values and culture of your company.
              </p>

              <div className="row mb-4">
                <div className="col-6">
                  <p className="mb-2" style={{ color: '#666', fontSize: '14px' }}># User-Friendly Interface</p>
                  <p className="mb-2" style={{ color: '#666', fontSize: '14px' }}># 95% Repeat business</p>
                </div>
                <div className="col-6">
                  <p className="mb-2" style={{ color: '#666', fontSize: '14px' }}># 98% Happy Clients</p>
                  <p className="mb-2" style={{ color: '#666', fontSize: '14px' }}># Quality Service UX</p>
                </div>
              </div>

              <div style={{ position: 'relative', display: 'inline-block' }}>
                <div style={{
                  position: 'absolute',
                  inset: '-2px',
                  background: 'linear-gradient(45deg, #e91e63, #9c27b0, #e91e63)',
                  borderRadius: '27px',
                  backgroundSize: '400% 400%',
                  animation: 'borderRotate 3s linear infinite'
                }}></div>
                <Link 
                  to="/contact" 
                  className="btn px-4 py-2"
                  style={{
                    position: 'relative',
                    background: 'white',
                    color: '#e91e63',
                    borderRadius: '25px',
                    fontWeight: '500',
                    textDecoration: 'none',
                    transition: 'all 0.3s ease'
                  }}
                >
                  Request A Quote â†’
                </Link>
              </div>
            </div>

            <div className="col-lg-6 scroll-animate fade-right delay-2">
              <div className="brand-values position-relative" style={{ textAlign: 'center' }}>
                <div className="floating" style={{
                  position: 'absolute',
                  top: '10%',
                  right: '20%',
                  background: '#fef3c7',
                  padding: '15px 25px',
                  borderRadius: '20px',
                  transform: 'rotate(-10deg)',
                  boxShadow: '0 10px 30px rgba(0,0,0,0.1)'
                }}>
                  <h4 style={{ color: '#1a237e', margin: 0, fontSize: '1.2rem' }}>Brand</h4>
                </div>

                <div className="floating" style={{
                  position: 'absolute',
                  top: '30%',
                  right: '5%',
                  background: '#f8bbd9',
                  padding: '15px 25px',
                  borderRadius: '20px',
                  transform: 'rotate(15deg)',
                  boxShadow: '0 10px 30px rgba(0,0,0,0.1)',
                  animationDelay: '0.5s'
                }}>
                  <h4 style={{ color: '#1a237e', margin: 0, fontSize: '1.2rem' }}>Quality</h4>
                </div>

                <div className="floating" style={{
                  position: 'absolute',
                  top: '60%',
                  right: '15%',
                  background: '#a7f3d0',
                  padding: '15px 25px',
                  borderRadius: '20px',
                  transform: 'rotate(-5deg)',
                  boxShadow: '0 10px 30px rgba(0,0,0,0.1)',
                  animationDelay: '1s'
                }}>
                  <h4 style={{ color: '#1a237e', margin: 0, fontSize: '1.2rem' }}>Value</h4>
                </div>

                <div className="floating" style={{
                  position: 'absolute',
                  top: '45%',
                  left: '10%',
                  background: '#bfdbfe',
                  padding: '15px 25px',
                  borderRadius: '20px',
                  transform: 'rotate(8deg)',
                  boxShadow: '0 10px 30px rgba(0,0,0,0.1)',
                  animationDelay: '1.5s'
                }}>
                  <h4 style={{ color: '#1a237e', margin: 0, fontSize: '1.2rem' }}>Trust</h4>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>

      {/* Services Section */}
      <section className="services-section py-5" style={{ backgroundColor: '#f8f9fa' }}>
        <div className="container">
          <div className="text-center mb-5 scroll-animate fade-up delay-1">
            <p className="text-uppercase fw-bold mb-3" style={{ color: '#e91e63', fontSize: '14px', letterSpacing: '1px' }}>SERVICE</p>
            <h2 className="fw-bold mb-3" style={{ color: '#1a237e', fontSize: '2.5rem' }}>Graphic Design services we offer</h2>
            <p className="text-muted" style={{ fontSize: '16px' }}>We think big and have hands in all leading technology platforms to provide you wide array of services.</p>
          </div>

          <div className="row g-4">
            {[
              {
                title: 'Logo Designing',
                description: 'A logo is a symbol made up of text and images that identifies a business. A good logo shows what a company does and what the brand values.',
                icon: 'ðŸŽ¨',
                color: '#fff3cd'
              },
              {
                title: 'Packaging Design',
                description: 'Packaging design is the process of conceptualizing and executing the physical form, and visual look and feel of a product\'s outer packaging.',
                icon: 'ðŸ“¦',
                color: '#d1ecf1'
              },
              {
                title: 'Brochure Design',
                description: 'A brochure is an informative paper document that can be folded into a template, pamphlet, or leaflet. A brochure can also be a set of related unfolded papers.',
                icon: 'ðŸ“„',
                color: '#f8d7da'
              },
              {
                title: 'Flyer Design',
                description: 'A flyer is usually a single, unfolded printed sheet that is used to draw attention to an event, service, product or idea.',
                icon: 'ðŸ“‹',
                color: '#e2e3e5'
              },
              {
                title: 'Newsletter Designing',
                description: 'A newsletter is an important point of contact. Whether you\'re designing one for a school, a business, another type of organization, or just for your family.',
                icon: 'ðŸ“°',
                color: '#d4edda'
              },
              {
                title: 'Business Card Designs',
                description: 'Business cards are cards bearing business information about a company or individual. It is an extremely effective marketing tool.',
                icon: 'ðŸ’¼',
                color: '#ffeaa7'
              }
            ].map((service, index) => (
              <div key={index} className={`col-lg-6 scroll-animate scale delay-${index + 2}`}>
                <div 
                  className="service-card p-4 h-100 d-flex"
                  style={{
                    backgroundColor: 'white',
                    borderRadius: '20px',
                    boxShadow: '0 10px 30px rgba(0,0,0,0.1)',
                    transition: 'all 0.3s ease',
                    cursor: 'pointer'
                  }}
                  onMouseEnter={(e) => e.currentTarget.style.transform = 'translateY(-10px)'}
                  onMouseLeave={(e) => e.currentTarget.style.transform = 'translateY(0)'}
                >
                  <div 
                    className="icon-container me-3 d-flex align-items-center justify-content-center"
                    style={{
                      width: '80px',
                      height: '80px',
                      backgroundColor: service.color,
                      borderRadius: '15px',
                      fontSize: '2rem',
                      flexShrink: 0
                    }}
                  >
                    {service.icon}
                  </div>
                  <div>
                    <h5 className="fw-bold mb-3" style={{ color: '#1a237e' }}>{service.title}</h5>
                    <p className="text-muted mb-0" style={{ fontSize: '14px', lineHeight: '1.5' }}>
                      {service.description}
                    </p>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="cta-section py-5" style={{ 
        backgroundColor: 'white',
        position: 'relative',
        overflow: 'hidden'
      }}>
        <div className="container">
          <div className="row justify-content-center text-center">
            <div className="col-lg-8 scroll-animate fade-up delay-1">
              <p className="text-uppercase fw-bold mb-3" style={{ color: '#e91e63', fontSize: '14px', letterSpacing: '1px' }}>LET'S WORK TOGETHER</p>
              <h2 className="fw-bold mb-4" style={{ color: '#1a237e', fontSize: '2.5rem', lineHeight: '1.2' }}>
                We Love to Listen to Your Requirements
              </h2>

              <div className="mb-4">
                <div style={{ position: 'relative', display: 'inline-block' }}>
                  <div style={{
                    position: 'absolute',
                    inset: '-2px',
                    background: 'linear-gradient(45deg, #4facfe, #e91e63, #ffc107, #4facfe)',
                    borderRadius: '27px',
                    backgroundSize: '400% 400%',
                    animation: 'borderRotate 3s linear infinite'
                  }}></div>
                  <Link 
                    to="/contact" 
                    className="btn px-4 py-2"
                    style={{
                      position: 'relative',
                      background: 'white',
                      color: '#1a237e',
                      borderRadius: '25px',
                      fontWeight: '500',
                      textDecoration: 'none',
                      transition: 'all 0.3s ease'
                    }}
                  >
                    Estimate Project â†’
                  </Link>
                </div>
              </div>

              <div className="d-flex align-items-center justify-content-center gap-2" style={{ color: '#666' }}>
                <span>Or call us now</span>
                <i className="fas fa-phone" style={{ color: '#1a237e' }}></i>
                <a href="tel:+918866392521" style={{ color: '#1a237e', textDecoration: 'none', fontWeight: '500' }}>
                  +91 88663 92521
                </a>
              </div>
            </div>
          </div>
        </div>

        {/* Decorative Elements */}
        <div style={{
          position: 'absolute',
          top: '20%',
          left: '-5%',
          width: '200px',
          height: '150px',
          background: 'linear-gradient(135deg, #ffd54f 0%, #ffb300 100%)',
          borderRadius: '50% 30% 50% 30%',
          opacity: 0.8
        }}></div>

        <div style={{
          position: 'absolute',
          bottom: '10%',
          right: '-5%',
          width: '180px',
          height: '120px',
          background: 'linear-gradient(135deg, #66bb6a 0%, #43a047 100%)',
          borderRadius: '30% 50% 30% 50%',
          opacity: 0.8
        }}></div>
      </section>
    </div>
  );
};

export default GraphicDesign;
